import s from './nav-bar.module.css'
import {NavLink} from "react-router-dom";

const Navbar = (props) => {
    return (
        <nav className={s.item}>
            <NavLink to="/profile" className = { navData => navData.isActive ? s.activeLink : s.item } id="1">Profile</NavLink>
            <NavLink to="/messages" className = { navData => navData.isActive ? s.activeLink : s.item } id="2">Messages</NavLink>
            <NavLink to="/news" className = { navData => navData.isActive ? s.activeLink : s.item } id="3">News</NavLink>
            <NavLink to="/music" className = { navData => navData.isActive ? s.activeLink : s.item } id="4">Music</NavLink>
            <NavLink to="/settings" className = { navData => navData.isActive ? s.activeLink : s.item } id="5">Settings</NavLink>
        </nav>
    );
};


export default Navbar;
